INSERT INTO `film` (`film_id`, `film_title`, `film_desc`, `film_minute`, `film_year`, `film_score`, `film_image`) VALUES
(1, 'Guardians of the Galaxy', 'A group of intergalactic criminals are forced to work together to stop a fanatical warrior from taking control of the universe.', 121, '2014', 76, 'img/0.jpg'),
(2, 'Prometheus', 'Following clues to the origin of mankind, a team finds a structure on a distant moon, but they soon realize they are not alone.', 124, '2012', 65, 'img/1.jpg'),
(3, 'Split', 'Three girls are kidnapped by a man with a diagnosed 23 distinct personalities. They must try to escape before the apparent emergence of a frightful new 24th.', 117, '2016', 62, ''),
(4, 'Sing', 'In a city of humanoid animals, a hustling theater impresario\'s attempt to save his theater with a singing competition becomes grander than he anticipates even as its finalists\' find that their lives will never be the same.', 108, '2016', 59, ''),
(5, 'Suicide Squad', 'A secret government agency recruits some of the most dangerous incarcerated super-villains to form a defensive task force. Their first mission: save the world from the apocalypse.', 123, '2016', 40, 'img/2.jpg'),
(6, 'The Great Wall', 'European mercenaries searching for black powder become embroiled in the defense of the Great Wall of China against a horde of monstrous creatures.', 103, '2016', 42, ''),
(7, 'La La Land', 'A jazz pianist falls for an aspiring actress in Los Angeles.', 128, '2016', 93, ''),
(8, 'Mindhorn', 'A has-been actor best known for playing the title character in the 1980s detective series \"Mindhorn\" must work with the police when a serial killer says that he will only speak with Detective Mindhorn, whom he believes to be a real person.', 89, '2016', 71, ''),
(9, 'The Lost City of Z', 'A true-life drama, centering on British explorer Col. Percival Fawcett, who disappeared while searching for a mysterious city in the Amazon in the 1920s.', 141, '2016', 78, ''),
(10, 'Passengers', 'A spacecraft traveling to a distant colony planet and transporting thousands of people has a malfunction in its sleep chambers. As a result, two passengers are awakened 90 years early.', 116, '2016', 41, 'img/3.jpg'),
(11, 'Fantastic Beasts and Where to Find Them', 'The adventures of writer Newt Scamander in New York\'s secret community of witches and wizards seventy years before Harry Potter reads his book in school.', 133, '2016', 66, ''),
(12, 'Hidden Figures', 'The story of a team of female African-American mathematicians who served a vital role in NASA during the early years of the U.S. space program.', 127, '2016', 74, ''),
(13, 'Rogue One', 'The Rebel Alliance makes a risky move to steal the plans for the Death Star, setting up the epic saga to follow.', 133, '2016', 65, ''),
(14, 'Moana', 'In Ancient Polynesia, when a terrible curse incurred by the Demigod Maui reaches an impetuous Chieftain\'s daughter\'s island, she answers the Ocean\'s call to seek out the Demigod to set things right.', 107, '2016', 81, 'img/4.jpg'),
(15, 'Colossal', 'Gloria is an out-of-work party girl forced to leave her life in New York City, and move back home. When reports surface that a giant creature is destroying Seoul, she gradually comes to the realization that she is somehow connected to this phenomenon.', 109, '2016', 70, ''),
(16, 'The Secret Life of Pets', 'The quiet life of a terrier named Max is upended when his owner takes in Duke, a stray whom Max instantly dislikes.', 87, '2016', 61, 'img/5.jpg'),
(17, 'Hacksaw Ridge', 'WWII American Army Medic Desmond T. Doss, who served during the Battle of Okinawa, refuses to kill people, and becomes the first man in American history to receive the Medal of Honor without firing a shot.', 139, '2016', 71, ''),
(18, 'Jason Bourne', 'The CIA\'s most dangerous former operative is drawn out of hiding to uncover more explosive truths about his past.', 123, '2016', 58, 'img/6.jpg'),
(19, 'Lion', 'A five-year-old Indian boy gets lost on the streets of Calcutta, thousands of kilometers from home. He survives many challenges before being adopted by a couple in Australia. 25 years later, he sets out to find his lost family.', 118, '2016', 69, ''),
(20, 'Arrival', 'When twelve mysterious spacecraft appear around the world, linguistics professor Louise Banks is tasked with interpreting the language of the apparent alien visitors.', 116, '2016', 81, ''),
(21, 'Gold', 'Kenny Wells, a prospector desperate for a lucky break, teams up with a similarly eager geologist and sets off on a journey to find gold in the uncharted jungle of Indonesia.', 120, '2016', 49, 'img/7.jpg'),
(22, 'Manchester by the Sea', 'A depressed uncle is asked to take care of his teenage nephew after the boy\'s father dies.', 137, '2016', 96, ''),
(23, 'Hounds of Love', 'A cold-blooded predatory couple while cruising the streets in search of their next victim, will stumble upon a 17-year-old high school girl, who will be sedated, abducted and chained in the strangers\' guest room.', 108, '2016', 72, ''),
(24, 'Trolls', 'After the Bergens invade Troll Village, Poppy, the happiest Troll ever born, and the curmudgeonly Branch set off on a journey to rescue her friends.', 92, '2016', 56, 'img/8.jpg'),
(25, 'Independence Day: Resurgence', 'Two decades after the first Independence Day invasion, Earth is faced with a new extra-Solar threat. But will mankind\'s new space defenses be enough?', 120, '2016', 32, 'img/9.jpg'),
(26, 'Paris pieds nus', 'Fiona visits Paris for the first time to assist her myopic Aunt Martha. Catastrophes ensue, mainly involving Dom, a homeless man who has yet to have an emotion or thought he was afraid of expressing.', 83, '2016', 0, ''),
(27, 'Bahubali: The Beginning', 'In ancient India, an adventurous and daring man becomes involved in a decades old feud between two warring people.', 159, '2015', 0, 'img/10.jpg'),
