(29, 'Bad Moms', 'When three overworked and under-appreciated moms are pushed beyond their limits, they ditch their conventional responsibilities for a jolt of long overdue freedom, fun, and comedic self-indulgence.', 100, '2016', 60, 'img/12.jpg'),
(30, 'Assassin\'s Creed', 'When Callum Lynch explores the memories of his ancestor Aguilar and gains the skills of a Master Assassin, he discovers he is a descendant of the secret Assassins society.', 115, '2016', 36, ''),
(31, 'Why Him?', 'A holiday gathering threatens to go off the rails when Ned Fleming realizes that his daughter\'s Silicon Valley millionaire boyfriend is about to pop the question.', 111, '2016', 39, ''),
(32, 'Nocturnal Animals', 'A wealthy art gallery owner is haunted by her ex-husband\'s novel, a violent thriller she interprets as a symbolic revenge tale.', 116, '2016', 67, 'img/13.jpg'),
(33, 'X-Men: Apocalypse', 'After the re-emergence of the world\'s first mutant, world-destroyer Apocalypse, the X-Men must unite to defeat his extinction level plan.', 144, '2016', 52, 'img/14.jpg'),
