(35, 'Resident Evil: The Final Chapter', 'Alice returns to where the nightmare began: The Hive in Raccoon City, where the Umbrella Corporation is gathering its forces for a final strike against the only remaining survivors of the apocalypse.', 107, '2016', 49, ''),
(36, 'Captain America: Civil War', 'Political interference in the Avengers\' activities causes a rift between former allies Captain America and Iron Man.', 147, '2016', 75, 'img/16.jpg'),
(37, 'Interstellar', 'A team of explorers travel through a wormhole in space in an attempt to ensure humanity\'s survival.', 169, '2014', 74, 'img/17.jpg'),
