(42, 'Moonlight', 'A chronicle of the childhood, adolescence and burgeoning adulthood of a young, African-American, gay man growing up in a rough neighborhood of Miami.', 111, '2016', 99, ''),
(43, 'Don\'t Fuck in the Woods', 'A group of friends are going on a camping trip to celebrate graduating college. But once they enter the woods, the proverbial shit starts to hit the fan.', 73, '2016', 0, ''),
(44, 'The Founder', 'The story of Ray Kroc, a salesman who turned two brothers\' innovative fast food eatery, McDonald\'s, into one of the biggest restaurant businesses in the world with a combination of ambition, persistence, and ruthlessness.', 115, '2016', 66, ''),
(45, 'Lowriders', 'A young street artist in East Los Angeles is caught between his father\'s obsession with lowrider car culture, his ex-felon brother and his need for self-expression.', 99, '2016', 57, ''),
(46, 'Pirates of the Caribbean: On Stranger Tides', 'Jack Sparrow and Barbossa embark on a quest to find the elusive fountain of youth, only to discover that Blackbeard and his daughter are after it too.', 136, '2011', 45, 'img/21.jpg'),
(47, 'Miss Sloane', 'In the high-stakes world of political power-brokers, Elizabeth Sloane is the most sought after and formidable lobbyist in D.C. But when taking on the most powerful opponent of her career, she finds winning may come at too high a price.', 132, '2016', 64, ''),
(48, 'Fallen', 'A young girl finds herself in a reform school after therapy since she was blamed for the death of a young boy. At the school she finds herself drawn to a fellow student, unaware that he is an angel, and has loved her for thousands of years.', 91, '2016', 0, 'img/22.jpg'),
(49, 'Star Trek Beyond', 'The USS Enterprise crew explores the furthest reaches of uncharted space, where they encounter a new ruthless enemy who puts them and everything the Federation stands for to the test.', 122, '2016', 68, ' https://images-na.ssl-images-amazon.com/images/M/MV5BODgzN2E1YjctODg5Yi00YzYwLWJjZjAtNDg2MGE2Y2MyYjBmXkEyXkFqcGdeQXVyNjM1MTQ0NTQ@._V1_UX182_CR0,0,182,268_AL_.jpg '),
(50, 'The Last Face', 'A director (Charlize Theron) of an international aid agency in Africa meets a relief aid doctor (Javier Bardem) amidst a political/social revolution, and together face tough choices ... See full summary »', 130, '2016', 16, ''),
(51, 'Star Wars: Episode VII - The Force Awakens', 'Three decades after the defeat of the Galactic Empire, a new threat arises. The First Order attempts to rule the galaxy and only a ragtag group of heroes can stop them, along with the help of the Resistance.', 136, '2015', 81, 'img/24.jpg'),
(52, 'Underworld: Blood Wars', 'Vampire death dealer, Selene (Kate Beckinsale) fights to end the eternal war between the Lycan clan and the Vampire faction that betrayed her.', 91, '2016', 23, ''),
(53, 'Mother\'s Day', 'Three generations come together in the week leading up to Mother\'s Day.', 118, '2016', 18, 'img/25.jpg'),
(54, 'John Wick', 'An ex-hitman comes out of retirement to track down the gangsters that took everything from him.', 101, '2014', 68, 'img/26.jpg'),
(55, 'The Dark Knight', 'When the menace known as the Joker wreaks havoc and chaos on the people of Gotham, the Dark Knight must come to terms with one of the greatest psychological tests of his ability to fight injustice.', 152, '2008', 82, 'img/27.jpg'),
(56, 'Silence', 'In the 17th century, two Portuguese Jesuit priests travel to Japan in an attempt to locate their mentor, who is rumored to have committed apostasy, and to propagate Catholicism.', 161, '2016', 79, ''),
(57, 'Don\'t Breathe', 'Hoping to walk away with a massive fortune, a trio of thieves break into the house of a blind man who isn\'t as helpless as he seems.', 88, '2016', 71, 'img/28.jpg'),
