(71, 'The Promise', 'Set during the last days of the Ottoman Empire, The Promise follows a love triangle between Michael, a brilliant medical student, the beautiful and sophisticated Ana, and Chris - a renowned American journalist based in Paris.', 133, '2016', 49, 'img/38.jpg'),
