(914, 'Coherence', 'Strange things begin to happen when a group of friends gather for a dinner party on an evening when a comet is passing overhead.', 89, '2013', 65, 'img/768.jpg'),
(915, 'Notorious', 'The life and death story of Notorious B.I.G. (a.k.a. Christopher Wallace), who came straight out of Brooklyn to take the world of rap music by storm.', 122, '2009', 60, 'img/769.jpg'),
(916, 'Goksung', 'A stranger arrives in a little village and soon after a mysterious sickness starts spreading. A policeman is drawn into the incident and is forced to solve the mystery in order to save his daughter.', 156, '2016', 81, ''),
(917, 'The Expendables 2', 'Mr. Church reunites the Expendables for what should be an easy paycheck, but when one of their men is murdered on the job, their quest for revenge puts them deep in enemy territory and up against an unexpected threat.', 103, '2012', 51, 'img/770.jpg'),
(918, 'The Girl Next Door', 'Based on the Jack Ketchum novel of the same name, The Girl Next Door follows the unspeakable torture and abuses committed on a teenage girl in the care of her aunt...and the boys who witness and fail to report the crime.', 91, '2007', 29, 'img/771.jpg'),
(919, 'Perfume: The Story of a Murderer', 'Jean-Baptiste Grenouille, born with a superior olfactory sense, creates the world\'s finest perfume. His work, however, takes a dark turn as he searches for the ultimate scent.', 147, '2006', 56, 'img/772.jpg'),
(920, 'The Golden Compass', 'In a parallel universe, young Lyra Belacqua journeys to the far North to save her best friend and other kidnapped children from terrible experiments by a mysterious organization.', 113, '2007', 51, 'img/773.jpg'),
(921, 'Centurion', 'A splinter group of Roman soldiers fight for their lives behind enemy lines after their legion is decimated in a devastating guerrilla attack.', 97, '2010', 62, 'img/774.jpg'),
(922, 'Scouts Guide to the Zombie Apocalypse', 'Three scouts, on the eve of their last camp-out, discover the true meaning of friendship when they attempt to save their town from a zombie outbreak.', 93, '2015', 32, 'img/775.jpg'),
(923, '17 Again', 'Mike O\'Donnell is ungrateful for how his life turned out. He gets a chance to rewrite his life when he tried to save a janitor near a bridge and jumped after him into a time vortex.', 102, '2009', 48, 'img/776.jpg'),
(924, 'No Escape', 'In their new overseas home, an American family soon finds themselves caught in the middle of a coup, and they frantically look for a safe escape from an environment where foreigners are being immediately executed.', 103, '2015', 38, 'img/777.jpg'),
(925, 'Superman Returns', 'Superman reappears after a long absence, but is challenged by an old foe who uses Kryptonian technology for world domination.', 154, '2006', 72, 'img/778.jpg'),
(926, 'The Twilight Saga: Breaking Dawn - Part 1', 'The Quileutes close in on expecting parents Edward and Bella, whose unborn child poses a threat to the Wolf Pack and the towns people of Forks.', 117, '2011', 45, 'img/779.jpg'),
(927, 'Precious', 'In New York City\'s Harlem circa 1987, an overweight, abused, illiterate teen who is pregnant with her second child is invited to enroll in an alternative school in hopes that her life can head in a new direction.', 110, '2009', 79, 'img/780.jpg'),
(928, 'The Sea of Trees', 'A suicidal American befriends a Japanese man lost in a forest near Mt. Fuji and the two search for a way out.', 110, '2015', 23, 'img/781.jpg'),
(929, 'Good Kids', 'Four high school students look to redefine themselves after graduation.', 86, '2016', 86, ''),
(930, 'The Master', 'A Naval veteran arrives home from war unsettled and uncertain of his future - until he is tantalized by The Cause and its charismatic leader.', 144, '2012', 0, 'img/782.jpg'),
(931, 'Footloose', 'City teenager Ren MacCormack moves to a small town where rock music and dancing have been banned, and his rebellious spirit shakes up the populace.', 113, '2011', 58, 'img/783.jpg'),
(932, 'If I Stay', 'Life changes in an instant for young Mia Hall after a car accident puts her in a coma. During an out-of-body experience, she must decide whether to wake up and live a life far different than she had imagined. The choice is hers if she can go on.', 107, '2014', 46, 'img/784.jpg'),
(933, 'The Ticket', 'A blind man who regains his vision finds himself becoming metaphorically blinded by his obsession for the superficial.', 97, '2016', 52, ''),
(934, 'Detour', 'A young law student blindly enters into a pact with a man who offers to kill his stepfather, whom he feels is responsible for the accident that sent his mother into a coma.', 97, '2016', 46, 'img/785.jpg'),
(935, 'The Love Witch', 'A modern-day witch uses spells and magic to get men to fall in love with her.', 120, '2016', 82, 'img/786.jpg'),
(936, 'Talladega Nights: The Ballad of Ricky Bobby', '#1 NASCAR driver Ricky Bobby stays atop the heap thanks to a pact with his best friend and teammate, Cal Naughton, Jr. But when a French Formula One driver, makes his way up the ladder, Ricky Bobby\'s talent and devotion are put to the test.', 108, '2006', 66, 'img/787.jpg'),
(937, 'The Human Centipede (First Sequence)', 'A mad scientist kidnaps and mutilates a trio of tourists in order to reassemble them into a human centipede, created by stitching their mouths to each others\' rectums.', 92, '2009', 33, 'img/788.jpg'),
(938, 'Super', 'After his wife falls under the influence of a drug dealer, an everyday guy transforms himself into Crimson Bolt, a superhero with the best intentions, but lacking in heroic skills.', 96, '2010', 50, 'img/789.jpg'),
(939, 'The Siege of Jadotville', 'Irish Commandant Pat Quinlan leads a stand off with troops against French and Belgian Mercenaries in the Congo during the early 1960s.', 108, '2016', 83, 'img/790.jpg'),
(940, 'Up in the Air', 'Ryan Bingham enjoys living out of a suitcase for his job traveling around the country firing people, but finds that lifestyle threatened by the presence of a potential love interest and a new hire.', 109, '2009', 0, 'img/791.jpg'),
(941, 'The Midnight Meat Train', 'A photographer\'s obsessive pursuit of dark subject matter leads him into the path of a serial killer who stalks late night commuters, ultimately butchering them in the most gruesome ways imaginable.', 98, '2008', 58, 'img/792.jpg'),
(942, 'The Twilight Saga: Eclipse', 'As a string of mysterious killings grips Seattle, Bella, whose high school graduation is fast approaching, is forced to choose between her love for vampire Edward and her friendship with werewolf Jacob.', 124, '2010', 58, 'img/793.jpg'),
(943, 'Transpecos', 'For three Border Patrol agents working a remote desert checkpoint, the contents of one car will reveal an insidious plot within their own ranks. The next 24 hours will take them on a treacherous journey that could cost them their lives.', 86, '2016', 73, 'img/794.jpg'),
(944, 'What\'s Your Number?', 'A woman looks back at the past nineteen men she\'s had relationships with in her life and wonders if one of them might be her one true love.', 106, '2011', 35, 'img/795.jpg'),
(945, 'Riddick', 'Left for dead on a sun-scorched planet, Riddick finds himself up against an alien race of predators. Activating an emergency beacon alerts two ships: one carrying a new breed of mercenary, the other captained by a man from Riddick\'s past.', 119, '2013', 49, 'img/796.jpg'),
(946, 'Triangle', 'The story revolves around the passengers of a yachting trip in the Atlantic Ocean who, when struck by mysterious weather conditions, jump to another ship only to experience greater havoc on the open seas.', 99, '2009', 66, 'img/797.jpg'),
(947, 'The Butler', 'As Cecil Gaines serves eight presidents during his tenure as a butler at the White House, the civil rights movement, Vietnam, and other major events affect this man\'s life, family, and American society.', 132, '2013', 0, 'img/798.jpg'),
(948, 'King Cobra', 'This ripped-from-the-headlines drama covers the early rise of gay porn headliner Sean Paul Lockhart a.k.a. Brent Corrigan, before his falling out with the producer who made him famous. When... See full summary »', 91, '2016', 48, 'img/799.jpg'),
(949, 'After Earth', 'A crash landing leaves Kitai Raige and his father Cypher stranded on Earth, a millennium after events forced humanity\'s escape. With Cypher injured, Kitai must embark on a perilous journey to signal for help.', 100, '2013', 33, 'img/800.jpg'),
(950, 'Kicks', 'Brandon is a 15 year old whose dream is a pair of fresh Air Jordans. Soon after he gets his hands on them, they\'re stolen by a local hood, causing Brandon and his two friends to go on a dangerous mission through Oakland to retrieve them.', 80, '2016', 69, ''),
(951, 'Me and Earl and the Dying Girl', 'High schooler Greg, who spends most of his time making parodies of classic movies with his co-worker Earl, finds his outlook forever altered after befriending a classmate who has just been diagnosed with cancer.', 105, '2015', 74, 'img/801.jpg'),
(952, 'The Descendants', 'A land baron tries to reconnect with his two daughters after his wife is seriously injured in a boating accident.', 115, '2011', 84, 'img/802.jpg'),
(953, 'Sex and the City 2', 'While wrestling with the pressures of life, love, and work in Manhattan, Carrie, Miranda, and Charlotte join Samantha for a trip to Abu Dhabi (United Arab Emirates), where Samantha\'s ex is filming a new movie.', 146, '2010', 27, 'img/803.jpg'),
(954, 'The Kings of Summer', 'Three teenage friends, in the ultimate act of independence, decide to spend their summer building a house in the woods and living off the land.', 95, '2013', 61, 'img/804.jpg'),
(955, 'Death Race', 'Ex-con Jensen Ames is forced by the warden of a notorious prison to compete in our post-industrial world\'s most popular sport: a car race in which inmates must brutalize and kill one another on the road to victory.', 105, '2008', 43, ' https://images-na.ssl-images-amazon.com/images/M/MV5BMTkwMDU1ODg5Ml5BMl5BanBnXkFtZTcwNjMzNjY3MQ@@._V1_UX182_CR0,0,182,268_AL_.jpg '),
(956, 'That Awkward Moment', 'Three best friends find themselves where we\'ve all been - at that confusing moment in every dating relationship when you have to decide \"So...where is this going?\"', 94, '2014', 36, 'img/806.jpg'),
(957, 'Legion', 'When a group of strangers at a dusty roadside diner come under attack by demonic forces, their only chance for survival lies with an archangel named Michael, who informs a pregnant waitress that her unborn child is humanity\'s last hope.', 100, '2010', 32, 'img/807.jpg'),
(958, 'End of Watch', 'Shot documentary-style, this film follows the daily grind of two young police officers in LA who are partners and friends, and what happens when they meet criminal forces greater than themselves.', 109, '2012', 68, 'img/808.jpg'),
(959, '3 Days to Kill', 'A dying CIA agent trying to reconnect with his estranged daughter is offered an experimental drug that could save his life in exchange for one last assignment.', 117, '2014', 40, 'img/809.jpg'),
(960, 'Lucky Number Slevin', 'A case of mistaken identity lands Slevin into the middle of a war being plotted by two of the city\'s most rival crime bosses: The Rabbi and The Boss. Slevin is under constant surveillance by relentless Detective Brikowski as well as the infamous assassin Goodkat and finds himself having to hatch his own ingenious plot to get them before they get him.', 110, '2006', 53, 'img/810.jpg'),
(961, 'Trance', 'An art auctioneer who has become mixed up with a group of criminals partners with a hypnotherapist in order to recover a lost painting.', 101, '2013', 61, 'img/811.jpg'),
(962, 'Into the Forest', 'After a massive power outage, two sisters learn to survive on their own in their isolated woodland home.', 101, '2015', 59, 'img/812.jpg'),
(963, 'The Other Boleyn Girl', 'Two sisters contend for the affection of King Henry VIII.', 115, '2008', 50, ' https://images-na.ssl-images-amazon.com/images/M/MV5BMTY2NzkyMzY1OF5BMl5BanBnXkFtZTcwMjk1MDU1MQ@@._V1_UX182_CR0,0,182,268_AL_.jpg '),
(964, 'I Spit on Your Grave', 'A writer who is brutalized during her cabin retreat seeks revenge on her attackers, who left her for dead.', 108, '2010', 27, 'img/814.jpg'),
(965, 'Custody', 'The lives of three women are unexpectedly changed when they cross paths at a New York Family Court.', 104, '2016', 72, ''),
(966, 'Inland Empire', 'As an actress starts to adopt the persona of her character in a film, her world starts to become nightmarish and surreal.', 180, '2006', 0, 'img/815.jpg'),
(967, 'L\'odyssée', 'Highly influential and a fearlessly ambitious pioneer, innovator, filmmaker, researcher and conservationist, Jacques-Yves Cousteau\'s aquatic adventure covers roughly thirty years of an inarguably rich in achievements life.', 122, '2016', 70, ''),
(968, 'The Walk', 'In 1974, high-wire artist Philippe Petit recruits a team of people to help him realize his dream: to walk the immense void between the World Trade Center towers.', 123, '2015', 0, 'img/816.jpg'),
(969, 'Wrecker', 'Best friends Emily and Lesley go on a road trip to the desert. When Emily decides to get off the highway and take a \"short cut,\" they become the target of a relentless and psychotic trucker... See full summary »', 83, '2015', 37, ''),
(970, 'The Lone Ranger', 'Native American warrior Tonto recounts the untold tales that transformed John Reid, a man of the law, into a legend of justice.', 150, '2013', 0, 'img/817.jpg'),
(971, 'Texas Chainsaw 3D', 'A young woman travels to Texas to collect an inheritance; little does she know that an encounter with a chainsaw-wielding killer is part of the reward.', 92, '2013', 62, 'img/818.jpg'),
(972, 'Disturbia', 'A teen living under house arrest becomes convinced his neighbor is a serial killer.', 105, '2007', 0, 'img/819.jpg'),
(973, 'Rock of Ages', 'A small town girl and a city boy meet on the Sunset Strip, while pursuing their Hollywood dreams.', 123, '2012', 47, 'img/820.jpg'),
(974, 'Scream 4', 'Ten years have passed, and Sidney Prescott, who has put herself back together thanks in part to her writing, is visited by the Ghostface Killer.', 111, '2011', 52, 'img/821.jpg'),
(975, 'Queen of Katwe', 'A Ugandan girl sees her world rapidly change after being introduced to the game of chess.', 124, '2016', 73, 'img/822.jpg'),
(976, 'My Big Fat Greek Wedding 2', 'A Portokalos family secret brings the beloved characters back together for an even bigger and Greeker wedding.', 94, '2016', 37, 'img/823.jpg'),
(977, 'Dark Places', 'Libby Day was only eight years old when her family was brutally murdered in their rural Kansas farmhouse. Almost thirty years later, she reluctantly agrees to revisit the crime and uncovers the wrenching truths that led up to that tragic night.', 113, '2015', 39, 'img/824.jpg'),
(978, 'Amateur Night', 'Guy Carter is an award-winning graduate student of architecture. He\'s got a beautiful wife and a baby on the way. The problem? He doesn\'t have \"his ducks in a row,\" which only fuels his ... See full summary »', 92, '2016', 38, 'img/825.jpg'),
(979, 'It\'s Only the End of the World', 'Louis (Gaspard Ulliel), a terminally ill writer, returns home after a long absence to tell his family that he is dying.', 97, '2016', 48, 'img/826.jpg'),
(980, 'The Skin I Live In', 'A brilliant plastic surgeon, haunted by past tragedies, creates a type of synthetic skin that withstands any kind of damage. His guinea pig: a mysterious and volatile woman who holds the key to his obsession.', 120, '2011', 70, ''),
(981, 'Miracles from Heaven', 'A young girl suffering from a rare digestive disorder finds herself miraculously cured after surviving a terrible accident.', 109, '2016', 44, 'img/827.jpg'),
(982, 'Annie', 'A foster kid, who lives with her mean foster mom, sees her life change when business tycoon and New York mayoral candidate Will Stacks makes a thinly-veiled campaign move and takes her in.', 118, '2014', 33, 'img/828.jpg'),
(983, 'Across the Universe', 'The music of the Beatles and the Vietnam War form the backdrop for the romance between an upper-class American girl and a poor Liverpudlian artist.', 133, '2007', 56, 'img/829.jpg'),
(984, 'Let\'s Be Cops', 'Two struggling pals dress as police officers for a costume party and become neighborhood sensations. But when these newly-minted \"heroes\" get tangled in a real life web of mobsters and dirty detectives, they must put their fake badges on the line.', 104, '2014', 30, 'img/830.jpg'),
(985, 'Max', 'A Malinois dog that helped American Marines in Afghanistan returns to the United States and is adopted by his handler\'s family after suffering a traumatic experience.', 111, '2015', 47, 'img/831.jpg'),
(986, 'Your Highness', 'When Prince Fabious\'s bride is kidnapped, he goes on a quest to rescue her... accompanied by his lazy useless brother Thadeous.', 102, '2011', 31, 'img/832.jpg'),
(987, 'Final Destination 5', 'Survivors of a suspension-bridge collapse learn there\'s no way you can cheat Death.', 92, '2011', 50, 'img/833.jpg'),
(988, 'Endless Love', 'The story of a privileged girl and a charismatic boy whose instant desire sparks a love affair made only more reckless by parents trying to keep them apart.', 104, '2014', 30, ' https://images-na.ssl-images-amazon.com/images/M/MV5BMjIzMDEzMDIxNF5BMl5BanBnXkFtZTcwNjY2OTIzMg@@._V1_UX182_CR0,0,182,268_AL_.jpg '),
(989, 'Martyrs', 'A young woman\'s quest for revenge against the people who kidnapped and tormented her as a child leads her and a friend, who is also a victim of child abuse, on a terrifying journey into a living hell of depravity.', 99, '2008', 89, 'img/835.jpg'),
(990, 'Selma', 'A chronicle of Martin Luther King\'s campaign to secure equal voting rights via an epic march from Selma to Montgomery, Alabama in 1965.', 128, '2014', 0, 'img/836.jpg'),
(991, 'Underworld: Rise of the Lycans', 'An origins story centered on the centuries-old feud between the race of aristocratic vampires and their onetime slaves, the Lycans.', 92, '2009', 44, 'img/837.jpg'),
(992, 'Taare Zameen Par', 'An eight-year-old boy is thought to be a lazy trouble-maker, until the new art teacher has the patience and compassion to discover the real problem behind his struggles in school.', 165, '2007', 42, 'img/838.jpg'),
(993, 'Take Me Home Tonight', 'Four years after graduation, an awkward high school genius uses his sister\'s boyfriend\'s Labor Day party as the perfect opportunity to make his move on his high school crush.', 97, '2011', 0, 'img/839.jpg'),
(994, 'Resident Evil: Afterlife', 'While still out to destroy the evil Umbrella Corporation, Alice joins a group of survivors living in a prison surrounded by the infected who also want to relocate to the mysterious but supposedly unharmed safe haven known only as Arcadia.', 97, '2010', 37, 'img/840.jpg'),
(995, 'Project X', '3 high school seniors throw a birthday party to make a name for themselves. As the night progresses, things spiral out of control as word of the party spreads.', 88, '2012', 48, 'img/841.jpg'),
(996, 'Secret in Their Eyes', 'A tight-knit team of rising investigators, along with their supervisor, is suddenly torn apart when they discover that one of their own teenage daughters has been brutally murdered.', 111, '2015', 45, 'img/842.jpg'),
(997, 'Hostel: Part II', 'Three American college students studying abroad are lured to a Slovakian hostel, and discover the grim reality behind it.', 94, '2007', 46, 'img/843.jpg'),
(998, 'Step Up 2: The Streets', 'Romantic sparks occur between two dance students from different backgrounds at the Maryland School of the Arts.', 98, '2008', 50, 'img/844.jpg'),
(999, 'Search Party', 'A pair of friends embark on a mission to reunite their pal with the woman he was going to marry.', 93, '2014', 22, 'img/845.jpg'),
(1000, 'Nine Lives', 'A stuffy businessman finds himself trapped inside the body of his family\'s cat.', 87, '2016', 11, 'img/846.jpg');
